$.fn.jaSlider=function(t){return this.each()(function(){var n,e;return e=$.extend({button:$("button.jaslidder-button"),menuDiv:$(".jaslider-menu"),contentDiv:$(".jaslider-content")},t),n=e.contentDiv.get(0).style.marginLeft,e.button.click(function(){return e.menuDiv.animate({left:0===parseInt(e.menuDiv.css("left"),10)?e.menuDiv.outerWidth():0}),e.contentDiv.animate({"margin-left":"20%"===n?"0%":"20%"})})})};